static SupportClasses.CustomCache unwrap(Cache cache) {
  Field field;
  try {
    field = cache.getClass().getDeclaredField("delegate");
  } catch (NoSuchFieldException e) {
    throw new IllegalStateException(e);
  }
  try {
    field.setAccessible(true);
    return (SupportClasses.CustomCache) field.get(cache);
  } catch (IllegalAccessException e) {
    throw new IllegalStateException(e);
  } finally {
    field.setAccessible(false);
  }
}

public static void removeBlockAsPlayer(EntityPlayer player, ItemStack stack, World world, BlockPos pos, boolean willDamage) {
    if (!world.isBlockLoaded(pos))
        return;

    IBlockState state = world.getBlockState(pos);
    Block block = state.getBlock();

    if (!world.isRemote &&
            !block.isAir(state, world, pos) &&
            state.getPlayerRelativeBlockHardness(player, world, pos) > 0 &&
            block.canHarvestBlock(world, pos, player)) {
        int exp = ForgeHooks.onBlockBreakEvent(world,
                ((EntityPlayerMP) player).interactionManager.getGameType(), (EntityPlayerMP) player, pos);
        if (exp == -1)
            return;

        if (!player.capabilities.isCreativeMode) {
            TileEntity tile = world.getTileEntity(pos);

            if (block.removedByPlayer(state, world, pos, player, true)) {
                block.onBlockDestroyedByPlayer(world, pos, state);

                block.harvestBlock(world, player, pos, state, tile, stack);
                block.dropXpOnBlockBreak(world, pos, exp);

            }
            if (willDamage)
                stack.damageItem(1, player);

        }
    }
}

public VipPlayer adapt(ResultSet resultSet) {
    try {

        Map<String, Vip> vips = new ConcurrentHashMap<>();

        String uuid = null;
        while (resultSet.next()) {
            Vip vip = ADAPTER.adapt(resultSet, ResultSet.class, Vip.class);
            if (vip == null) continue;
            vips.put(vip.getType().getIdentifier(), vip);
            uuid = resultSet.getString("uuid");
        }

        if (vips.isEmpty() || uuid == null) return null;

        VipPlayer vipPlayer = new VipPlayer(UUID.fromString(uuid));
        vipPlayer.addVips(vips);
        return vipPlayer;

    } catch (Exception exception) {
        return null;
    }
}

