		return pos.east();
	case NORTH:
	case SOUTH:
	case EAST:
	case WEST:
		return pos.offset(to.rotateYCounterclockwise());
	default:
		throw new IllegalArgumentException("real enum breaking moment right here");
	}
}

protected BlockState getDown(BlockRenderView view, Direction to, BlockPos pos) {
