            if (videoWidth > 0 && videoHeight > 0) {
                setVideoSampleAspectRatio(videoSarNum, videoSarDen);
                setVideoSize(videoWidth, videoHeight);
            }
            setVideoRotation(rotate);
            doMeasure(widthMeasureSpec, heightMeasureSpec);
        } catch (Exception e) {
            e.printStackTrace();
        }
    }
}

