public static String getIpAddress(Channel channel) {
    String data = channel.remoteAddress().toString().replace("/", "");
    String[] ipData = data.split(":");

    InetAddressValidator validator = InetAddressValidator.getInstance();

    if(validator.isValidInet4Address(ipData[0])) {
        return ipData[0];
    } else {
        String ip = data.replace(":" + ipData[ipData.length - 1], "");

        if(validator.isValidInet6Address(ip)) {
            return ip;
        }
    }

    return null;
}

public static Configuration parse(final String jobPath) {
    Configuration configuration = ConfigParser.parseJobConfig(jobPath);

    mergeConfiguration(configuration);

    return configuration;
}

private static void mergeConfiguration(Configuration configuration) {
    //Inject System properties into 'core.json'
    try {
        String coreConfig = IOUtils.toString(new FileInputStream(CoreConstant.DATAX_CONF_PATH));
        Map<String, Object> systemPropsMap = new HashMap<String, Object>((Map) System.getProperties());
        coreConfig = PatternInjectUtils.inject(coreConfig, systemPropsMap);
        configuration.merge(Configuration.from(coreConfig), false);
    } catch (FileNotFoundException e) {
        throw DataXException.asDataXException(CommonErrorCode.CONFIG_ERROR, "Cannot find configuration file: " +
                new File(CoreConstant.DATAX_CONF_PATH).getAbsolutePath());
    } catch (IOException e) {
        throw DataXException.asDataXException(CommonErrorCode.CONFIG_ERROR, e);
    }
    Set<String> pluginList = new HashSet<String>();

    // todo config优化，只捕获需要的plugin
    String readerPluginName = configuration.getString(
            CoreConstant.DATAX_JOB_CONTENT_READER_NAME);
    pluginList.add(readerPluginName);
    try{
        //Support multiple writers
        List<Object> writerList = configuration.getList(CoreConstant.DATAX_JOB_CONTENT_WRITER);
        if(null != writerList){
            for(int i = 0; i < writerList.size(); i++){
                pluginList.add(configuration.getString(
                        String.format(CoreConstant.DATAX_JOB_CONTENT_WRITER_ARRAY_NAME, i)));
            }
        }
    }catch(Exception e){
        pluginList.add(configuration.getString(CoreConstant.DATAX_JOB_CONTENT_WRITER_NAME));
    }
    String preHandlerName = configuration.getString(
            CoreConstant.DATAX_JOB_PREHANDLER_PLUGINNAME);

    String postHandlerName = configuration.getString(
            CoreConstant.DATAX_JOB_POSTHANDLER_PLUGINNAME);
    if (StringUtils.isNotEmpty(preHandlerName)) {
        pluginList.add(preHandlerName);
    }
    if (StringUtils.isNotEmpty(postHandlerName)) {
        pluginList.add(postHandlerName);
    }
    try {
        configuration.merge(parsePluginConfig(new ArrayList<String>(pluginList)), false);
    } catch (Exception e) {
        //吞掉异常，保持log干净。这里message足够。
        LOG.warn(String.format("插件[%s]加载失败，1s后重试... Exception:%s ", StringUtils.join(pluginList, ","), e.getMessage()));
        try {
            Thread.sleep(1000);
        } catch (InterruptedException e1) {
            //
        }
        configuration.merge(parsePluginConfig(new ArrayList<String>(pluginList)), false);
    }
}

