protected void handleError(final String errorMsg, final Exception e) throws Exception {
  error(errorMsg);
  if (e != null) {
    throw new Exception(errorMsg, e);
  } else {
    throw new Exception(errorMsg);
  }
}

protected List<String> getCommandList() {
  final List<String> commands = new ArrayList<>();
  commands.add(this.jobProps.getString(COMMAND));
  for (int i = 1; this.jobProps.containsKey(COMMAND + "." + i); i++) {
    commands.add(this.jobProps.getString(COMMAND + "." + i));
  }

  return commands;
}

public void cancel() throws InterruptedException {
  // in case the job is waiting
  synchronized (this) {
    this.killed = true;
    this.notify();
    if (this.process == null) {
      // The job thread has not checked if the job is killed yet.
      // setting the killed flag should be enough to abort the job.
      // There is no job process to kill.
      return;
    }
  }
  try {
    this.process.awaitStartup();
    warn("Kill with signal TERM failed. Killing with KILL signal.");
    // FIXME Use the hardkill method to solve the bug that cannot kill the child process.
    this.process.hardKill();
  } catch (InterruptedException ie){
    throw ie;
  }finally {
    // FIXME Solve the bug that hive task cannot be killed using spark submitted by command type.
    if(jobProps.get("type").equals(COMMAND)) {
      //kill job by application_id
      String logFilePath = this.jobProps.get(CommonJobProperties.JOB_LOG_FILE);
      info("log file path is: " + logFilePath);
      if(org.apache.commons.lang.StringUtils.isBlank(logFilePath)){
        info("log file does not exist.");
        return;
      }
      HadoopJobUtils.killAllHadoopJobs(logFilePath, getLog());
      HadoopJobUtils.killBdpClientJob(getCommandList(), logFilePath, getLog());
    }
  }
}

